import {useState} from "react";
import "./App.css";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "23-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "23-10-10", fvk: "MD"},
  ]);
  console.log(patienter);
  return (
    <div className="App">
      <h1>Teest</h1>
      <br />
      {/* list of patients */}
      <ul>
        {patienter.map((p) => {
          return (
            <li>
              {p.plats} {p.datum} {p.fvk}
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default App;
